import {
    Link
} from "react-router-dom";
import s from './HeaderModal.module.css';

const MENU = [
    {
        title: 'Home',
        to: '/',
    },
    {
        title: 'Characters',
        to: '/characters',
    }
];

const HeaderModal = ({ isActive, onChangeActive, onIsClicked }) => {

    const isClicked = true;

    const onMenuClick = ({ isActive }) => {
        onChangeActive(!isActive);
        onIsClicked && onIsClicked(isClicked);

    }


    return (
        <>
            <div className={s.container}>
                <div className={s.menu}>
                    {
                        MENU.map(({ title, to }, index) => (
                            <li key={index} onClick={onMenuClick}>
                                <Link to={to}>
                                    {title}
                                </Link>
                            </li>
                        ))
                    }
                </div>
            </div>

        </>
    );
}

export default HeaderModal;
